import React from 'react';

export const ListSortEmptyState = () => (
  <div className="description-copy">
    You can use a sort to:
    <br />
    Order tasks by priority.
    <br />
    Show notes by creation date.
    <br />
    Show recently contacted customers.
  </div>
);
